<template>
	<view  class="tc fs28 ptb40">
		<view class="tc">
			<image class="w280" :src="imgMode" mode="widthFix"></image>
		</view>
		<view class="text-muted fs26 mt20">
			{{text}}
		</view>
	</view>
</template>

<script>
	export default {
		data() {
			return {
				img: ''
			};
		},
		props: {
			text: {
				type: String,
				default: '暂无数据'
			},
			mode: {
				type: String,
				default: 'data'
			}
		},
		computed:{
			imgMode(){
				let img = ''
				switch(this.mode) {
					case 'data':
					img = 'data:image/png;base64,'
					break
					case 'cart':
					img = 'data:image/png;base64,'
					break
					case 'address':
					img = 'data:image/png;base64,'
					break
					case 'coupon':
					img = 'data:image/png;base64,'
					break
					case 'favor':
					img = 'data:image/png;base64,'
					break
					case 'news':
					img = 'data:image/png;base64,'
					break
					case 'message':
					img = 'data:image/png;base64,'
					break
				}
				return img
			}
		}
	}
</script>

